import React, {useEffect} from 'react';
import { Button, Container, Typography,  Stack} from "@mui/material";

import StudentCard from '../StudentCard/StudentCard';

const ListView = () => {

    let students = [] 
    useEffect(async () => {
        try {
          const res = await fetch('http://localhost:8000/api/students/');
          if (!res.ok) {
            throw res;
          }
          students = await res.json()

        } catch (err) {
          return { error: err };
        }
      }, 
        [])
    console.log('s', students)
    const dummyStudents = [{name: "John", email: "john@home", age: 22}, {name: "Clare", email: "clare@home", age: 43}]
    return (
        <>
        <Container maxWidth="md">
            <Stack direction="column" spacing={2} sx={{position: "relative", top: "100px", alignItems:"center"}}>
                <Typography  variant="h5">Students</Typography>
                <Button variant="outlined" sx={{maxWidth:"150px", fontSize: '10px', height:"auto" }}>Create New</Button>
                <div>
                    {dummyStudents.map(ds => <StudentCard student={ds}/>)}
                </div>
            </Stack>
        </Container>
        </>
    )
}

export default ListView
